import React from 'react';


class Jobs extends React.Component {
    constructor() {
        super();
        this.state = {
            jobs: []
        }
    }

    async componentDidMount() {
        let jobs = await fetch('https://jobs.github.com/positions.json?description=react', {
            method: 'get',
            cors:true,
            headers: {
                "Access-Control-Allow-Origin": "*"
              }
        });

        let jobsArray = await jobs.json();
        console.log(jobsArray);
    }
    render() {
        return (
            <div className="jobs">

            </div>
        )
    }

}

export default Jobs;
